import './App.css';
import Inicio from './paginas/inicio';
import Skills from './paginas/skills';
import Knowledge from './paginas/Knowledge';


import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";


function App() {
  return(
    <BrowserRouter>
      <Routes>
      <Route
          path='/'
          element={<Inicio />}
        />
        <Route
          path='/About'
          element={<Aboutt />}
        />  
        <Route
          path='/Skills'
          element={<Skills />}
        />  
        <Route
          path='/Knowledge'
          element={<Knowledge />}
        />  
      </Routes>

    </BrowserRouter>
  )
}

export default App;
